import React, { Component } from 'react'
import { connect } from 'react-redux'
import './style.css'
import { addPostAction, changeAlertStatus } from 'actions/PostAction'
import ImagePreview from 'components/ImagePreview'

class CreatePost extends Component {
  fileReader = new FileReader()
  state = {
    userName: 'Sonal Verma',
    lookingFor: 'Resellers',
    time: null,
    location: 'Ahemdabad',
    postText: null,
    imgUrls: [],
    profileImage:
      'data:image/jpeg;base64,',
    comments: [],
  }
  componentDidMount() {
    this.fileReader.addEventListener('load', this.imageLoaded)
  }
  componentWillUnmount() {
    this.fileReader.removeEventListener('load', this.imageLoaded)
  }
  imageLoaded = event => {
    const dataURI = this.fileReader.result
    this.setState({
      imgUrls: [...this.state.imgUrls, dataURI],
    })
  }
  changeBackground = (event, imageUrl = null) => {
    const file = imageUrl ? imageUrl : event.target.files[0]
    console.log(file)
    if (file) {
      this.fileReader.readAsDataURL(file)
    }
  }
  onTextChange = event => {
    const { target: { value: postText } } = event
    this.setState({
      postText,
    })
  }

  postData = () => {
    this.props.dispatch(addPostAction({ newPostData: { ...this.state, time: Date.now() } }))
    this.setState({
      postText: '',
      imgUrls: [],
      time: null,
    })
    this.props.dispatch(
      changeAlertStatus({ alertText: 'Post Added Succesfully!', showAlert: true })
    )
  }
  selectPostType = event => {
    const { target: { value: lookingFor } } = event
    this.setState({
      lookingFor,
    })
  }
  render() {
    return (
      <div className="create__post__container flex__container dir__column">
        <div className="create__post__write flex__container">
          <span className="icon-pencil-circled" />
          <textarea
            className="flex__rest"
            placeholder="Write a Post..."
            rows="2"
            value={this.state.postText}
            onChange={e => this.onTextChange(e)}
          />
        </div>
        <div className="create__post__type__container flex__container dir__column">
          <div className="flex__container p-tb-10 f-20 flex__space__bw flex__acenter">
            <span>Select Post Type</span>
            <button
              type="button"
              className="post__save__button"
              onClick={this.postData}
              disabled={!this.state.postText}
            >
              Post
            </button>
          </div>
          <input
            type="radio"
            id="resellers"
            checked={this.state.lookingFor === 'Resellers'}
            className="hidden"
            onChange={e => this.selectPostType(e)}
            name="postType"
            value="Resellers"
          />
          <label
            htmlFor="resellers"
            className="flex__container active m-b-10 icon-ok-circled2 icon__button"
          >
            For Sale - Looking for Resellers
          </label>
          <div className="flex__container flex__space__bw">
            <input
              type="radio"
              id="suppliers"
              checked={this.state.lookingFor === 'Suppliers'}
              className="hidden"
              onChange={e => this.selectPostType(e)}
              name="postType"
              value="Suppliers"
            />
            <label
              htmlFor="suppliers"
              className="flex__container flex__49 mob__100 icon-ok-circled2 icon__button"
            >
              Looking for Suppliers
            </label>
            <input
              type="radio"
              id="update"
              checked={this.state.lookingFor === 'Update'}
              className="hidden"
              onChange={e => this.selectPostType(e)}
              name="postType"
              value="Update"
            />
            <label
              htmlFor="update"
              className=" flex__container flex__49 mob__100 icon-ok-circled2 icon__button"
            >
              General Update
            </label>
          </div>
        </div>
        <div className="flex__container create__post__footer flex__space__bw">
          <input
            id="imageUpload"
            accept="image/*"
            className="hidden"
            type="file"
            onChange={this.changeBackground}
          />
          <label htmlFor="imageUpload" className="icon-camera icon__button" onClick={this.addImage}>
            Add photos
          </label>
          <div className="text__right">Post to FB Page</div>
        </div>
        <div className="flex__container create__post__img__preview flex__space__bw">
          <ImagePreview imgUrls={this.state.imgUrls} />
        </div>
      </div>
    )
  }
}

const mapStateToProps = ({ postReducer }) => ({
  postReducer,
})
export default connect(mapStateToProps)(CreatePost)
